      <form name="image-name-form" id="image-name-form" method='POST' action="/">
        <label>
          Text the descripitons:: 
        </label>
          <input type="text" name="image-description" id="image-description" />
        <label className='submit-buttom'>
          <input type="submit" value="Submit" />
        </label>
      </form>
    </div>
    <div className="result-image-generated">
      <p>Name 1, Name 2</p>
    </div>
    </>
  );
}

export default PetNames;
